import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function LeaderLogin({ setAuth }) {
    const [formData, setFormData] = useState({
        username: '',
        password: '',
        role: 'Leader'
    });
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);
    const navigate = useNavigate();

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        // Trim and normalize inputs
        const username = formData.username.trim();
        const password = formData.password.trim();

        // Simulate API call
        setTimeout(() => {
            // Leader credentials (case-sensitive)
            if (username === 'Leader' && password === 'Nehilot@2024') {
                const userData = {
                    user_id: 100,
                    username: 'Leader',
                    role: 'Leader',
                    full_name: 'Choir Leader',
                    email: 'leader@nehilot.com'
                };
                localStorage.setItem('user', JSON.stringify(userData));
                setAuth(userData);
                navigate('/admin'); // Redirect to admin panel
            } 
            // Admin credentials (case-sensitive)
            else if (username === 'Admin' && password === 'Admin@Nahilot') {
                const userData = {
                    user_id: 1,
                    username: 'Admin',
                    role: 'Admin',
                    full_name: 'System Administrator',
                    email: 'admin@nehilot.com'
                };
                localStorage.setItem('user', JSON.stringify(userData));
                setAuth(userData);
                navigate('/admin');
            } else {
                setError('Invalid credentials. Please check username and password.');
            }
            setLoading(false);
        }, 1000);
    };

    return (
        <div className="container mt-5">
            <div className="row justify-content-center">
                <div className="col-md-6 col-lg-4">
                    <div className="card shadow">
                        <div className="card-header bg-warning text-dark">
                            <h4 className="mb-0">
                                <i className="fas fa-crown me-2"></i>
                                Leader/Admin Login
                            </h4>
                        </div>
                        <div className="card-body">
                            {error && (
                                <div className="alert alert-danger">{error}</div>
                            )}
                            
                            <form onSubmit={handleSubmit}>
                                <div className="mb-3">
                                    <label className="form-label">Username</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        name="username"
                                        value={formData.username}
                                        onChange={handleChange}
                                        required
                                        placeholder="Enter username"
                                    />
                                </div>
                                
                                <div className="mb-3">
                                    <label className="form-label">Password</label>
                                    <input
                                        type="password"
                                        className="form-control"
                                        name="password"
                                        value={formData.password}
                                        onChange={handleChange}
                                        required
                                        placeholder="Enter password"
                                    />
                                </div>
                                
                                <div className="mb-3">
                                    <div className="card bg-light">
                                        <div className="card-body p-2">
                                            <small className="text-muted">
                                                <strong>Test Credentials:</strong>
                                                <div className="mt-1">
                                                    <strong>Leader:</strong> Username: <code>Leader</code>, Password: <code>Nehilot@2024</code>
                                                </div>
                                                <div>
                                                    <strong>Admin:</strong> Username: <code>Admin</code>, Password: <code>Admin@Nahilot</code>
                                                </div>
                                            </small>
                                        </div>
                                    </div>
                                </div>
                                
                                <div className="d-grid gap-2">
                                    <button 
                                        type="submit" 
                                        className="btn btn-warning"
                                        disabled={loading}
                                    >
                                        {loading ? (
                                            <>
                                                <span className="spinner-border spinner-border-sm me-2" role="status" aria-hidden="true"></span>
                                                Logging in...
                                            </>
                                        ) : 'Login as Leader/Admin'}
                                    </button>
                                </div>
                            </form>
                            
                            <div className="text-center mt-3">
                                <p className="mb-0">
                                    Member login? 
                                    <a href="/login" className="ms-1">Click here</a>
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default LeaderLogin;
